def snap_number_to_string(NUMBER):
	# https://stackoverflow.com/questions/6999737/convert-from-hex-character-to-unicode-character-in-python
	n = NUMBER
	i = 0
	b = []
	while n >> i:

		b.append(n >> i & 0xFF)

		i += 1

	return bytes(b).decode('utf8')
	
